vanna_sql_query_without_schema:
SELECT district, 
       (treated - discharged - died) AS active_cases
FROM covid_cases_11_may;

vanna_sql_query_with_schema:
SELECT district, 
       (treated - discharged - died) AS active_cases
FROM covid_cases_11_may;

vanna_sql_query_without_schema:
SELECT district, beds_available_with_oxygen 
FROM bed_vacancies_health_centers_and_district_hospitals_11_may 
ORDER BY beds_available_with_oxygen DESC;

vanna_sql_query_with_schema:
SELECT district, beds_available_with_oxygen 
FROM bed_vacancies_health_centers_and_district_hospitals_11_may 
ORDER BY beds_available_with_oxygen DESC;

vanna_sql_query_without_schema:
UPDATE covid_cases_11_may
SET active_cases = 1300
WHERE district = 'Perambalur';

